import React from 'react';
import { useSelector } from 'react-redux';

const TodoItem = () => {
    const data = useSelector((state)=>state.todo.value);
    console.log(data);
    return(
        <div>
            {
                datavalue.map((res)=>{
                    console.log(res);
                    <h1>{res}</h1>
                })
            }
        </div>
    )
}

export default TodoItem;
